INSERT INTO `events` (`id`, `name`, `topic`, `сontent`, `image`, `date_event`, `location`, `contacts`, `analytics`, `organizers`, `participants`, `date`) VALUES
(24, 'Ах, не говорите мне про Австрию! Я ничего не понимаю', '', '— Eh bien, mon prince. Gnes et Lucques ne sont plus que des apanages, des поместья, de la famille Buonaparte. Non, je vous préviens que si vous ne me dites pas que nous avons la guerre, si vous vous permettez encore de pallier toutes les infamies, toutes les atrocités de cet Antichrist (ma parole, jy crois) — je ne vous connais plus, vous plus mon ami, vous ntes plus мой верный раб, comme vous dites 1. Ну, здравствуйте, здравствуйте. Je vois que je vous fais peur 2, садтесь и рассказывайте.\r\nТак говорила в июле 1805 года известная Анна Павловна Шерер, фрейлина и приближенная императрицы Марии Феодоровны, встречая важного и чиновного князя Василия, первого приехавшего на ее вечер. Анна Павловна кашляла несколько дней, у нее был грипп, как она говорила (грипп был тогда новое слово, употреблявшееся только редкими). В записочках, разосланных утром с красным лакеем, было написано без различия во всех:\r\n«Si vous navez rien de mieux  faire, Monsieur le comte (или mon prince), et si la perspective de passer la soichez une pauvre malade ne vous effraye pas trop, je serai charde vous voir chez moi entre 7 et 10 heures. Annette Scherer» 3.\r\n— Dieu, quelle virulente sortie! 4 — отвечал, нисколько не смутясь такою встречей, вошедший князь, в придворном, шитом мундире, в чулках, башмаках и звездах, с светлым выражением плоского лица.\r\nОн говорил на том изысканном французском языке, на котором не только говорили, но и думали наши деды, и с теми, тихими, покровительственными интонациями, которые свойственны состаревшемуся в свете и при дворе значительному человеку. Он подошел к Анне Павловне, поцеловал ее руку, подставив ей свою надушенную и сияющую лысину, и покойно уселся на диване.\r\n— Avant tout dites-moi, comment vous allez, che amie? 5 Успокойте меня, — сказал он, не изменяя голоса и тоном, в котором из-за приличия и участия просвечивало равнодушие и даже насмешка.\r\n— Как можно быть здоровой... когда нравственно страдаешь? Разве можно, имея чувство, оставаться спокойною в наше время? — сказала Анна Павловна. — Вы весь вечер у меня, надеюсь?\r\n— А праздник английского посланника? Нынче середа. Мне надо показаться там, — сказал князь. — Дочь заедет за мной и повезет меня.\r\n— Я думала, что нынешний праздник отменен, Je vous avoue que toutes ces fes et tous ces feux dartifice commencent  devenir insipides 6.\r\n— Ежели бы знали, что вы этого хотите, праздник бы отменили, — сказал князь по привычке, как заведенные часы, говоря вещи, которым он и не хотел, чтобы верили.\r\n— Ne me tourmentez pas. Eh bien, qua-t-on didpar rapport Novosilzoff? Vous savez tout 7.\r\n— Как вам сказать? — сказал князь холодным, скучающим тоном. —  que Buonaparte a vaisseaux, et je crois que nous sommes en train \r\nКнязь Василий говорил всегда лениво, как актер говорит роль старой пиесы. Анна Павловна Шерер, напротив, несмотря на свои сорок лет, была преисполнена оживления и порывов.', 56, '1620968400000', 'Парк Горького', '8 (800) 659 02 87, Елена', 16, '{}', '{}', '1610993908000'),
(25, 'Мы одни должны искупить кровь праведника. На кого нам ', '', 'Ах, не говорите мне про Австрию! Я ничего не понимаю, может быть, но Австрия никогда не хотела и не хочет войны. Она предает нас. Россия одна должна быть спасительницей Европы. Наш благодетель знает свое высокое призвание и будет верен ему. Вот одно, во что я верю. Нашему доброму и чудному государю предстоит величайшая роль в мире, и он так добродетелен и хорош, что Бог не оставит его, и он исполнит свое призвание задавить гидру революции, которая теперь еще ужаснее в лице этого убийцы и злодея. Мы одни должны искупить кровь праведника. На кого нам Она отказалась очистить Мальту. Она хочет видеть, ищет заднюю мысль наших действий. Что они сказали Новосильцеву? Ничего. Они не поняли, они не могли понять самоотвержения нашего императора, который ничего не хочет для себя и все хочет для блага мира. И что они обещали? Ничего. И что обещали, и того не будет А! Я очень рад буду, — сказал князь. — Скажите, — прибавил он, как будто только что вспомнив что-то и особенно-небрежно, тогда как то, о чем он спрашивал, было главной целью его посещения, — правда, что  12 желает назначения барона Функе первым секретарем в Вену', 57, '1615587480000', 'ул.Пушкинская, д.60', '8 (980) 129 76 67, Иван', 16, '{}', '{}', '1610994363000');

